import { Navigate } from "react-router-dom";


const user = JSON.parse(localStorage.getItem("authenticated") || "[]")

const RegisterProtectedRoutes = () => {
  return user ? <Navigate to="/googlesheet"/> : <Navigate to="/signup" />;
};

export default RegisterProtectedRoutes;
